/*Table structure for table `sys_notice` */

DROP TABLE IF EXISTS `sys_notice`;

CREATE TABLE `sys_notice` (
  `notice_id` int(4) NOT NULL AUTO_INCREMENT COMMENT '公告ID',
  `notice_title` varchar(50) NOT NULL COMMENT '公告标题',
  `notice_type` char(1) NOT NULL COMMENT '公告类型（1通知 2公告）',
  `notice_content` varchar(20000) DEFAULT NULL COMMENT '公告内容',
  `status` char(1) DEFAULT '0' COMMENT '公告状态（0正常 1关闭）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`notice_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='通知公告表';

/*Data for the table `sys_notice` */

insert  into `sys_notice`(`notice_id`,`notice_title`,`notice_type`,`notice_content`,`status`,`create_by`,`create_time`,`update_by`,`update_time`,`remark`) values (1,'到岗人员测温情况日通报','2','<p style=\"padding: 0px; margin-bottom: 0px; color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 16px; text-align: justify; line-height: 37px;\"><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">公司各部：</span></p><p style=\"padding: 0px; margin-bottom: 0px; color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 16px; text-align: justify; line-height: 37px; text-indent: 43px;\"><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">为加强常态化疫情防控工作落实落地，督促疫情防控措施有效执行，现对7月13日到岗人员测温情况通报如下：</span></p><p style=\"padding: 0px; margin-bottom: 0px; color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 16px; text-align: justify; line-height: 37px; text-indent: 43px;\"><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">今日公司到岗人数</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">903</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">人，</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">已</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">测温人数</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">903</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">人，未测温人数</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">0</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">人，详见</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">下表</span><span style=\"font-family: 仿宋_GB2312; font-size: 21px;\">。</span></p><table width=\"567\" style=\"margin-bottom: 10px; color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 16px; text-align: justify; background-color: rgb(255, 255, 255);\"><tbody><tr class=\"firstRow\" style=\"height: 38px;\"><td width=\"34\" valign=\"center\" style=\"padding-top: 1px; padding-right: 1px; padding-left: 1px; margin: 0px; background: transparent; border: 1px solid rgb(0, 0, 0);\"><p style=\"paddin